DELIMITER $$
CREATE TRIGGER `tr_update_dataFechamento_on_tblog_chamado_insert` AFTER INSERT ON `tblog_chamado` FOR EACH ROW BEGIN
    IF NEW.status = 4 THEN
        UPDATE tbchamados
        SET dataFechamento = NEW.dataAlteracao
        WHERE IDChamado = NEW.referencia;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_update_status_and_responsavel_on_log_insert` AFTER INSERT ON `tblog_chamado` FOR EACH ROW BEGIN
    -- Atualizar o status do chamado
    UPDATE tbchamados
    SET status_chamado = NEW.status
    WHERE IDChamado = NEW.referencia;

    -- Atualizar o responsavel do chamado
    UPDATE tbchamados
    SET responsavel = NEW.responsavel
    WHERE IDChamado = NEW.referencia;
END
$$
DELIMITER ;

